import React from 'react';
import {Button} from 'reactstrap';
import './LearningPage.style.scss';
import LearningListItem from '../../componentsforLearning/LearningListItem/LearningListItem';
import DATA from '../../componentsforLearning/ListItemData/ListItemData';


const LerningPageList=()=>{
    const {sections}=DATA;
      return (
        <div className="col-10 learningPage" >

            <div className="lp-header">
                  <h2 className="lp-Title">Articles</h2>
            </div>
            {sections.map((item)=>(
            <div className="lp-content ">
                <LearningListItem key={item.id} item={item}/>

            </div>
            ))}
        </div>
    );
}

export default LerningPageList;
